import React, { useState, useEffect } from 'react';

function App() {
  const [dat, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000", {
      method: 'GET', // Use 'method' instead of 'methods'
      headers: {
        'Content-Type': 'application/json', // Correct the header value
      },
    })
      .then(resp => resp.json())
      .then(resp => setData(resp))
      .catch(error => console.log(error));
  }, []);

  return (
    <div>
      <h1>Helloooo:</h1>
      <ul>
        {dat.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
